import React, { useEffect, useState } from "react";
import "../../styles/WhyRGM.css";

import g10 from "../../assets/gallery/images/gallery10.jpg";
import g11 from "../../assets/gallery/images/gallery11.jpg";
import g12 from "../../assets/gallery/images/gallery12.jpg";
import g13 from "../../assets/gallery/images/gallery13.jpg";
import g14 from "../../assets/gallery/images/gallery14.jpg";
import g15 from "../../assets/gallery/images/gallery15.jpg";
import g16 from "../../assets/gallery/images/gallery16.jpg";
import g17 from "../../assets/gallery/images/gallery17.jpg";
import g18 from "../../assets/gallery/images/gallery18.jpg";
import g19 from "../../assets/gallery/images/gallery19.jpg";
import g20 from "../../assets/gallery/images/gallery20.jpg";
import g21 from "../../assets/gallery/images/gallery21.jpg";
import g22 from "../../assets/gallery/images/gallery22.jpg";
import g23 from "../../assets/gallery/images/gallery23.jpg";
import g24 from "../../assets/gallery/images/gallery24.jpg";
import g25 from "../../assets/gallery/images/gallery25.jpg";

const heroImages = [
  g10,g11,g12,g13,g14,g15,g16,g17,
  g18,g19,g20,g21,g22,g23,g24,g25
];

function WhyRGM() {
  const [current, setCurrent] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrent(prev => (prev + 1) % heroImages.length);
    }, 5000);
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="why-rgm-page">

      {/* HERO */}
      <section
        className="why-hero"
        style={{ backgroundImage: `url(${heroImages[current]})` }}
      >
        <div className="hero-overlay">
          <h1 className="hero-title">
            Why RGM Family
          </h1>
          <p>
            At RGM, you‚Äôre not just joining a company ‚Äî
            you‚Äôre becoming part of a family that grows together.
          </p>
        </div>
      </section>

      {/* INTRO */}
      <section className="why-intro">
        <p>
          RGM may be a young company, but our foundation is built on something
          timeless: <strong>trust, respect, and people-first values</strong>.
          We believe success comes from taking care of our drivers, employees,
          and partners like family ‚Äî because when they succeed, we succeed.
        </p>
      </section>

      {/* VALUES */}
      <section className="why-values">
        <div className="value-card">
          <h3>ü§ù Family First Culture</h3>
          <p>We treat everyone with respect and fairness.</p>
        </div>

        <div className="value-card">
          <h3>üõ° Integrity & Trust</h3>
          <p>Honesty, transparency, and ethical decisions.</p>
        </div>

        <div className="value-card">
          <h3>üöõ Driver-Focused Mindset</h3>
          <p>Clear communication and reliable support.</p>
        </div>

        <div className="value-card">
          <h3>üìà Growth Together</h3>
          <p>Long-term relationships, not short-term gains.</p>
        </div>

        <div className="value-card">
          <h3>üß† Smart Technology</h3>
          <p>Modern tools with a human touch.</p>
        </div>

        <div className="value-card">
          <h3>üíô Support Beyond Work</h3>
          <p>Support inside and outside the job.</p>
        </div>
      </section>

      {/* FAMILY MESSAGE */}
      <section className="family-message">
        <h2>This Is More Than a Job</h2>
        <p>
          When you join RGM, you‚Äôre joining a team that looks out for one another.
        </p>
      </section>

      {/* CTA */}
      <section className="why-cta">
        <h2 className="cta-title">Let‚Äôs Talk About Your Future With RGM</h2>
        <button>Contact RGM Family</button>
      </section>

    </div>
  );
}

export default WhyRGM;
